`,n.jsxs(e.blockquote,{children:[`
`,n.jsxs(e.p,{children:["A resource is an endpoint in the ",n.jsx(e.a,{href:"https://kubernetes.io/docs/concepts/overview/kubernetes-api/",children:"Kubernetes API"})," that stores a collection of ",n.jsx(e.a,{href:"https://kubernetes.io/docs/concepts/overview/working-with-objects/#kubernetes-objects",children:"API objects"})," of a certain kind; for example, the built-in pods resource contains a collection of Pod objects."]}),`
