`,n.jsxs(e.p,{children:["This code initializes and starts the core components of the Kubernetes controller. First, a manager (",n.jsx(e.code,{children:"mgr"}),") is created using the ",n.jsx(e.code,{children:"ctrl.NewManager"})," function, which serves as the runtime environment for the controller, handling shared resources, clients, and the scheme that defines the resource types the manager can work with. If the manager cannot start due to configuration issues, an error is logged, and the program exits. Next, a reconciler is created and registered with the manager. The reconciler defines the logic for ensuring the desired state of the custom resource (",n.jsx(e.code,{children:"Application"}),") matches the actual state in the cluster. This is done using ",n.jsx(e.code,{children:"ctrl.NewControllerManagedBy"}),", which specifies the resource type the controller will manage and configures the reconciler with the manager's client, scheme, and a Kubernetes clientset for making direct API calls. If the controller cannot be created or registered, the program exits with an error. Finally, the manager is started using ",n.jsx(e.code,{children:"mgr.Start"}),", which begins watching the specified resource and handling reconciliation requests. A signal handler is set up to ensure graceful shutdowns. If the manager fails to start, an error is logged, and the program exits. This setup combines the manager and reconciler to enable the operator to monitor and maintain the desired state of custom resources in the Kubernetes cluster."]}),`
