`,n.jsx(e.p,{children:"Machine learning is a subset of AI that learns to make decisions by fitting mathematical models to observed data. This area has seen explosive growth and is now (incorrectly) almost synonymous with the term AI. Machine learning models are generally categorized into two. Supervised and Unsupervised learning models. In this article we shall take a look at Supervised Learning models, how they work and different concepts associated with it."}),`
`,n.jsx(e.h2,{children:"What is Supervised Learning"}),`
`,n.jsx(e.p,{children:"Supervised learning is a field of machine learning where mathematical models are trained on labeled data from datasets using the input and expected output inorder for the model to learn the relationship between the input and output. That aim is for the models to be able to predict data from new unseen data."}),`
`,n.jsx(e.h2,{children:"Problems in Supervised learning"}),`
`,n.jsx(e.p,{children:"Problems in Supervised learning are usually classified into two kinds. Supervised learning models primarily address two types of problems. Regression and Classification models."}),`
`,n.jsxs(e.p,{children:[n.jsx(e.strong,{children:"Regression problems"})," are problems that require a model that predicts continuous values. Think of a problem which requires us to predict the price of a house, we are to create a model that takes inputs which are various characteristics like location, size etc, and from these inputs we predict a price. We can also have problems that predict more than one value and these are called multivariable regression problems. Take an example of a model that predicts the age and height of a tree."]}),`
`,n.jsxs(e.p,{children:[n.jsx(e.strong,{children:"Classification Problems"})," on the other hand are problems that produce a categorical output, for example a model that predicts if it will rain or not. This is actually called a binary Classification problem since the output has only two states to exist. However, the model can predict an output that can be in one of more than 2 possible categories. These are called multiclass classification problems. Take an example of a model that predicts what animal is in a picture, and the animal can be anything from a dog, cat, cow, goat etc."]}),`
`,n.jsx(e.h2,{children:"Supervised Learning Models"}),`
