`,n.jsx(e.h3,{children:"Horizontal Scaling"}),`
`,n.jsx(e.p,{children:"When it comes to horizontal scaling, I decided to re-engineer the Drivers to run as a distributed system in cases where there are multiple driver instances running. This distributed system is powered by NATS JetStream Consumers"}),`
`,n.jsxs(e.p,{children:["At the core each Conveyor CI Driver operates as a ",n.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/consumers",children:"JetStream Consumer"}),". They listen to a ",n.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/streams",children:"stream"})," which filters out required messages and pushes them to the driver. The driver then carries out the required tasks depending on the payload recieved from the stream."]}),`
`,n.jsx(e.p,{children:"The Drivers are configured to use Explicit acknowledgement with the value set to 1 so that each task it handles one by one and this would prevent a possibility of one driver handling multiple tasks at once possibly causing resource contention. Acknowledgement occurs once the message is recieved by the driver. We also set the Delivery policy to All, so that no task is skipped and all tasks are handled. Another feature that Jet"}),`
`,n.jsx(e.p,{children:"By utilising JetStream, it enables driver to be able to infinitly scale horizontally and become more failt torolent by utilizing various inbuilt NATS features."}),`
`,n.jsx(e.p,{children:n.jsx(e.img,{src:"/img/drivers1.png",alt:""})}),`
`,n.jsx(e.h2,{children:"Conclusion"}),`
`,n.jsx(e.p,{children:"Designing a robust scheduling algorithm for Conveyor CI Drivers was a necessary and will definetely improve the functionality and reliability of the Drivers when the scheduling mechanism is added to the Conveyor CI codebase. By combining FIFO, priority-based, and constraint-aware scheduling with a distributed model powered by JetStream, I’ve managed to create a system that not only prevents resource overloads but also opens the door for true horizontal scaling and more features like fault tolorence. This isn’t just a theoretical improvement—it directly addresses real-world pain points for teams running concurrent workloads on shared infrastructure. There’s still room to refine and optimize, but this foundation sets the stage for building CI/CD systems that are both resilient and adaptive under pressure. This might be the greatest improvement to Conveyor CI yet."})]})}function k4(t={}){const{wrapper:e}=t.components||{};return e?n.jsx(e,{...t,children:n.jsx($m,{...t})}):$m(t)}function _m(t){const e={a:"a",blockquote:"blockquote",code:"code",figure:"figure",h1:"h1",h2:"h2",h3:"h3",h4:"h4",img:"img",li:"li",ol:"ol",p:"p",pre:"pre",span:"span",strong:"strong",ul:"ul",...t.components};return n.jsxs(n.Fragment,{children:[n.jsx(e.h1,{children:"A Guide to contributing to the Conveyor CI Driver Runtime"}),`
`,n.jsx(e.p,{children:"A detailed guide to contributing to the Conveyor CI Driver runtime."}),`
`,n.jsx(e.h2,{children:"Introduction"}),`
`,n.jsx(e.p,{children:"A brief introduction on the Conveyor CI Driver runtime."}),`
`,n.jsxs(e.p,{children:["The Conveyor CI Driver runtime is a collection of SDKs(Software Development Kits) used by developers to build Conveyor CI ",n.jsx(e.a,{href:"https://conveyor.open.ug/docs/concepts/drivers",children:"Drivers"}),". These SDKs are libraries that contain Utility functions that expose different Conveyor CI functionality. In this Guide we shall explore how one can contribute to the Conveyor CI Driver Runtime. This Guide is written to be language agnostic, meaning it can guide you to build or contribute to a driver runtime of your language of choice."]}),`
`,n.jsx(e.h2,{children:"How the Driver Runtime Works"}),`
`,n.jsx(e.p,{children:"Lets explore what the Runtime is"}),`
`,n.jsx(e.h3,{children:"What is the Driver Runtime"}),`
`,n.jsx(e.p,{children:"You can think of the Driver runtime as the wrapper of Driver applications and is the environment in which Drivers execute. You can define it as the software layer that provides necessary services, infrastructure, and behavior for executing the driver. Think of how language runtime work like the JVM, Go Runtime, V8, CPython etc. If you where to write a program in those languages, run in an environment that contains your code and the language runtime."}),`
`,n.jsx(e.p,{children:"So even when building a Conveyor CI Driver, the final program is a combination of the Driver runtime and your custom Driver code."}),`
`,n.jsx(e.p,{children:n.jsx(e.img,{src:"https://conveyor.open.ug/assets/images/Driver-Runtime-276f53e45dbccb2ee74a6112e2561b56.png",alt:"Conveyor CI"})}),`
`,n.jsx(e.h3,{children:"What Features does it Provide"}),`
`,n.jsx(e.p,{children:"As mentioned earlier, the driver runtime provides necessary services and utilities for building CI Drivers. Some of these features are not just exclusive to the runtime but rather and extension of the base features provided by the Conveyor CI Ecosystem. These features include:"}),`
`,n.jsxs(e.ul,{children:[`
`,n.jsx(e.li,{children:"A mealtime Event System: The driver runtime is designed to ensure drivers receive and publish events within the Conveyor System to ensure quick and instant execution of tasks."}),`
`,n.jsxs(e.li,{children:["Log Management: The Driver runtime provided a ",n.jsx(e.a,{href:"https://conveyor.open.ug/docs/concepts/drivers#driver-logger",children:"Driver Logger"}),", that provides drivers with functionality to export and save necessary logs in real-time. These can then be fetched or streamed in real-time or for future use."]}),`
`,n.jsx(e.li,{children:"Horizontal Scaling: The Driver runtime provides out of the box Horizontal Scaling to Drivers, meaning once you build a driver. It comes with the ability to horizontally scale into a distributed system efficiently without you writing any custom code. This feature can be really important in Cloud Native environments."}),`
`,n.jsx(e.li,{children:"Conveyor CI API Server Interaction: No driver runtime package is complete without utility functions to interact with the Conveyor API Server to for example create and manipulate Resources."}),`
`,n.jsx(e.li,{children:"Observability out of the Box: The Driver runtime is designed to provide a comprehensive observability platform that follows all the three pillars that include Metrics, Tracing and Logging."}),`
`]}),`
`,n.jsx(e.p,{children:"And many more..."}),`
`,n.jsx(e.h3,{children:"Driver runtime Components"}),`
`,n.jsx(e.p,{children:"The Driver runtime contains mainly two components. The Driver Manager and the Client Library."}),`
`,n.jsx(e.h3,{children:"Driver Manager"}),`
`,n.jsxs(e.p,{children:["The Driver manager, the component that encapsulates the Driver and provides utilities that are used by the Driver. By design, it is usually a ",n.jsx(e.code,{children:"Class"})," or a Class-like data type that has a ",n.jsx(e.code,{children:"run()"})," method that is called to start the program. Its is responsible for the following functionality."]}),`
`,n.jsxs(e.p,{children:["Listening for events from Conveyor CI sent via NATS Jetstream: This is accomplished using JetStream ",n.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/streams",children:"Streams"})," and ",n.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/consumers",children:"Consumers"}),". The Driver manager contains a Consumer that listens for events from the ",n.jsx(e.code,{children:"messages"})," stream and filters out subjects depending on the resources that the Driver defines to listen to."]}),`
`,n.jsxs(e.p,{children:["Provides the Driver Logger to the Driver. The driver logger is a component that collects logs from the driver and send them to Grafana Loki for Storage. After storing them it also streams them via a NATS connection on the subject with the following semantics ",n.jsx(e.code,{children:"driver:{DRIVER_NAME}:logs:{RUN_ID}"})," with the place holders ",n.jsx(e.code,{children:"DRIVER_NAME"})," and ",n.jsx(e.code,{children:"RUN_ID"})," referring to the name of the driver and the current run id respectively."]}),`
`,n.jsxs(e.p,{children:["Runs the ",n.jsx(e.code,{children:"Reconcile"})," function of the Drivers upon each event from JetStream and passes in the appropriate parameters."]}),`
`,n.jsx(e.p,{children:n.jsx(e.img,{src:"https://conveyor.open.ug/assets/images/Driver-manager-class-cc690397861d80f84278a93150b7c2fb.png",alt:"Conveyor CI Driver Manager Class Diagram"})}),`
`,n.jsx(e.h3,{children:"Driver Logger"}),`
`,n.jsx(e.p,{children:"The Driver logger component is in charge of collecting logs from the Driver, sending them to Loki Grafana for storage and also streaming them via the NATs connection. It accomplished this by following the rules stated above in the Driver manager section"}),`
`,n.jsx(e.p,{children:n.jsx(e.img,{src:"https://conveyor.open.ug/assets/images/Driver-Logger-class-driver-7a5f1d7850726371ef18304b17294bec.png",alt:"Conveyor CI Driver Logger Class Diagram"})}),`
`,n.jsx(e.h3,{children:"Driver"}),`
`,n.jsxs(e.p,{children:["The Driver is the main component that developers interact with. It contains the ",n.jsx(e.code,{children:"Reconcile"})," function that contains the custom code that includes the drivers intended functionality. When initializing it, the constructor must require the developer to specify the Resources that the driver wants to control, the driver name and also the Reconcile function. The Reconcile function, is a function that takes in these parameters. ",n.jsx(e.code,{children:"payload"}),", ",n.jsx(e.code,{children:"event"}),", ",n.jsx(e.code,{children:"driverName"}),", ",n.jsx(e.code,{children:"logger"}),"."]}),`
`,n.jsx(e.p,{children:n.jsx(e.img,{src:"https://conveyor.open.ug/assets/images/Driver-class-diagram-f4271da3d3decaf566fa9e89362cc1e8.png",alt:"Conveyor CI Driver Class Diagram"})}),`
`,n.jsx(e.h3,{children:"Client Library"}),`
`,n.jsx(e.p,{children:"The client Library is a component of the driver runtime that contains functions that interact with the Conveyor CI API Server. these are normal HTTP Requests to the API Server. It also has the ability to fetch Conveyor CI API Server metadata like the API Host and Port."}),`
`,n.jsx(e.p,{children:n.jsx(e.img,{src:"https://conveyor.open.ug/assets/images/Client-class-diagram-45e1c90d4e6733c663b66902ca91242a.png",alt:"Conveyor CI API Client Diagram"})}),`
`,n.jsxs(e.blockquote,{children:[`
`,n.jsxs(e.p,{children:[n.jsx(e.strong,{children:"Note"}),": The Class Diagrams above represent the general expected Structure of those components however due to differences is language syntax and semantics in programming languages. The structure can be tweaked to provide the Developers a good user experience."]}),`
`]}),`
`,n.jsx(e.h3,{children:"Component Diagram"}),`
`,n.jsx(e.p,{children:n.jsx(e.img,{src:"https://conveyor.open.ug/assets/images/Runtime-Components-5b3eabcccb9e256be453bff1e3ad8262.png",alt:"Conveyor CI Driver Runtime Component Diagram"})}),`
`,n.jsx(e.h2,{children:"Contributing Guide"}),`
`,n.jsx(e.p,{children:"Now that you have a solid understanding of the high level structure of the Driver runtime. Lets move on to the practical guide of the Workflow of Contributing to or building a driver runtime SDK package. Shall first go through the Development Environment setup then also go through the general contribution workflow followed when contributing to the source code of official Conveyor CI Driver runtime SDKs."}),`
`,n.jsx(e.h3,{children:"Environment Setup"}),`
`,n.jsxs(e.p,{children:["To setup your environment to run conveyor, all you need is to have Docker installed on you computer. You can head over to the ",n.jsx(e.a,{href:"https://docs.docker.com/engine/install/",children:"Docker Installation Page"})," to install it on your system."]}),`
`,n.jsxs(e.p,{children:["Once you have it, you will need to download two configuration files that are used to run Conveyor API Server and System dependencies. Head over to the ",n.jsx(e.a,{href:"https://github.com/open-ug/conveyor/releases",children:"Conveyor CI Releases Page"})," and on the assests of the latest release, download ",n.jsx(e.code,{children:"compose.yml"})," and ",n.jsx(e.code,{children:"loki.yml"})," and store them in the same directory. Or you can simply run these commands."]}),`
